import { Component, OnInit } from '@angular/core';
import { EnviarfacturaService } from 'src/app/services/facturacioncxc/enviarfactura.service';
import { TraspasoMercanciaService } from 'src/app/services/importacion/traspaso-mercancia.service';
import * as html2pdf from 'html2pdf.js';
import Swal from 'sweetalert2';


@Component({
  selector: 'app-reportessaldosventas',
  templateUrl: './reportessaldosventas.component.html',
  styleUrls: ['./reportessaldosventas.component.css']
})
export class ReportessaldosventasComponent implements OnInit {

  logo;
  rfcE;
  nombreE;
  isVisible: boolean;
  logoBase64: string;
  rizteklogo: string;
  arrayFinal: any;
  facturas = new Array<any>();

  constructor(public traspasoSVC: TraspasoMercanciaService, public enviarfact: EnviarfacturaService) { }

  ngOnInit() {
    this.obtenerReporte();
  }


  obtenerReporte(){
    Swal.fire({
      title: 'Cargando ...',
      onBeforeOpen () {
        Swal.showLoading ()
      },
      onAfterClose () {
        Swal.hideLoading()
      },
      allowOutsideClick: false,
      allowEscapeKey: false,
      allowEnterKey: false
    })

    this.arrayFinal = []
    this.facturas = []

    this.rfcE = this.enviarfact.empresa.RFC;
    this.nombreE = this.enviarfact.empresa.RazonSocial;
    this.logo = '../../../assets/images/' + this.rfcE + '.png'


    let query = 'select pedidos.*, DetallePedidos.*,(select top 1 nombre from Cliente where idClientes=pedidos.IdCliente) as Cliente ,(select top 1 textoextra from DetalleFactura2 left join OvFactura on DetalleFactura2.IdFactura=OvFactura.idFactura where OvFactura.folioPedido = pedidos.Folio and DetalleFactura2.ClaveProducto=DetallePedidos.ClaveProducto order by convert(float,textoextra) asc) as Saldo from pedidos left join detallepedidos on pedidos.IdPedido=DetallePedidos.IdPedido order by pedidos.Folio desc'
    let consulta = {
      'consulta': query
    };
    this.traspasoSVC.getQuery(consulta).subscribe((data: any) => {
      console.log(data);
      for (let i = 0; i < data.length; i++){

        if (data[i].Saldo != '0'){

          if (data[i].Saldo === null){
            data[i].Saldo = data[i].Cantidad
          }
          this.facturas.push(data[i])
        }
        

      }
      this.arrayFinal = this.facturas;
      
        Swal.close();
    
    })
  }




  exportarPDF() {
    this.logoEmpresa();
    this.isVisible = false;
    setTimeout(() => {
      const content: Element = document.getElementById('pdf2');
      const option = {
        margin: [3, .2, 3, .2],
        filename: 'Reporte.pdf',
        image: { type: 'jpeg', quality: 1 },
        html2canvas: { scale: 1, logging: true, scrollY: -2},
        jsPDF: { unit: 'cm', format: 'letter', orientation: 'portrait' },
        pagebreak: { avoid: '.pgbreak' }
      };

      html2pdf().from(content).set(option).toPdf().get('pdf').then(function (pdf) {
        var totalPages = pdf.internal.getNumberOfPages();
        pdf.setFontSize(10);
        pdf.setTextColor(70);
        for (var i = 1; i <= totalPages; i++) {
          pdf.setPage(i);
          var headerReportes = 'data:image/png;base64,';;
          console.log(this.logoBase64);
          pdf.addImage(headerReportes, "PNG", -3, 0, 25, 3)
          // pdf.text('Pro lactoIngredientes S. de R.L. M.I. de C.V.', 1, 26);
          var footerReportes = 'data:image/png;base64,';
          pdf.addImage(footerReportes, "PNG", 18, 25, 2, 2);
        }
      }).save();
    }, 1000);
    setTimeout(() => { this.isVisible = true; }, 1000);
  }

  logoEmpresa(){
    if ( this.enviarfact.empresa.RFC=='PLA11011243A'){
      this.logoBase64 = "data:image/png;base64,";
      
    
  }else if ( this.enviarfact.empresa.RFC=='AIN140101ME3'){
    this.logoBase64 = "data:image/png;base64,";

  }
  this.rizteklogo = 'data:image/png;base64,'
}
}
